column8:
細やかなミストを噴射して、それをサーキュレーターの風によって遠くまで幅広く拡散しながら気化冷却して涼しい風を送ります。<br>扇風機と違って風が幅広く拡散し、エアコンとの併用で夏は涼しく・冬は暖かいのがサーキュレーターです。<br>夏は冷房・冬は暖房と併用することにより空気循環させて冷暖房の効率アップ！<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：株式会社 ヒロコーポレーション<br>サイズ：W400×D220×H808mm<br>重量：5.62kg<br>タンクの容量：2L<br>コードの長さ：約1.8m<br>定格・安全装置：AC100V、50/60HZ、70W、電流ヒューズ<br>付属品：リモコン、取扱説明書兼保証書<br>機能：ミスト、スピード切り替え、スイングルーバー<br><br>購入単位：1セット(2台)<br><table width=610 border=0 cellspacing=0><tr><td bgcolor=#ffffff><p style=margin:10px;>配送種別：<b>別送品　<font color=#ff0000>代引不可　返品不可　配送日時指定不可</font></b><br><font size=2>　※商品はメーカーより直送させて頂くため、代金引換でのご注文はお受け致しかねます。<br>　※こちらの商品は他の商品とは別のお届けとなります。<br>　※メーカー直送のため、納品・請求書は商品とは別に郵送させていただきます。<br>　※商品はメーカーより直送させて頂くため、ご希望配送日時の指定はできません。<br>　※メーカーにて欠品発生時はこちらからご連絡させて頂くこともございます。</font><br><br>※北海道・沖縄・離島は送料別途見積りとなります。</p></td></tr></table></p></td></tr></table><img src=http://image.rakuten.co.jp/onestep/cabinet/parts/pix_daibi.gif><img src=http://image.rakuten.co.jp/onestep/cabinet/parts/pix_henpin.gif><br><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>お買い得 げきやす 最安値挑戦 さいやすねちょうせん 家電 かでん 電化製品 でんかせいひん 冷暖房機器 れいだんぼう 空調機器 空調 くうちょう 扇風機 せんぷうき サーキュレーター さーきゅれーたー ファン ふぁん ミストファンサーキュレーター みすとふぁんさーきゅれーたー リビング 生活家電 せいかつかでん 就寝 しゅうしん 寝室 しんしつ 部屋 へや 2L ミスト みすと ホワイト スイングルーバー P95012 p95012 9N1131 9n1131 4562351022941 HT-2016 2台セット 2だいせっと</font></td></tr></table><style type="text/css">
