夏のエアコンや冬の暖房時にも年中使える、室内空気を循環しECOな空調機です！<br>真上にも送風できますので、洗濯物を乾燥することもできます。<br>・3スピード<br>・自動90度水平首振り<br>・手動90度設定<br>◆電源/AC100V 50/60Hz 56W<br>◆消費電力/39W・43W<br>◆適応床面積(目安)/12畳<br>◆コード長さ/約1.6m<br>◆モーター回転数/50Hz(弱：1100RPM、中：1500RPM、強：1950RPM)、60Hz(弱：1200RPM、中：1600RPM、強：2050RPM)<br>◆風速/50Hz(弱：3.4m/秒、中：4.4m/秒、強：6.2m/秒)、60Hz(弱：3.5m/秒 中：4.7m/秒 強：6.5m/秒)<br>◆ノイズ/50Hz(弱：30db 中：43db 強：60db)、60Hz(弱：32db 中：45db 強：62db)<br>◆風量/50Hz(弱：19m3/分 中：23m3/分 強：28m3/分)、60Hz(弱：20m3/分 中：25m3/分 強：30m3/分)<br>【使用上の注意】<br>・風を体に直接当てないでください。<br>・カバーや吸い込み口に指や棒などを入れないでください。<br>・湿気・水気の多い場所、ホコリのひどい場所、直射日光や暖房器具の熱があたる場所では使用しないでください。<br>・お手入れの際は必ず電源プラグをコンセントから抜いてください。<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：株式会社イトウ<br>サイズ：W24×H34.5×D24cm<br>重量：約2.8kg<br>カラー：ホワイト<br><br>購入単位：1台<br>配送種別：在庫品</p></td></tr></table><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>お買い得 げきやす 最安値挑戦 さいやすねちょうせん P95033 9N1184 9ｎ1184 4562351024341 HTS-F118C 株式会社イトウ 電化製品 電化 でんかせいひん でんか 空調機器 くうちょうきき ファン 扇風機 せんぷうき かでん 家電 空調 くうちょう エコ えこ 省エネ 節電 せつでん サーキュレーター さーきゅれーたー 生活家電 せいかつかでん 空調循環機 くうちょうじゅんかんき</font></td></tr></table><style type="text/css">
